import { Col, Row } from 'react-bootstrap'
import { connect } from 'react-redux'
import React from 'react'

import ListPokemonFamilyLoader from './ListPokemonFamilyLoader'

const ListPokemonFamily = ({ familyID, familyMembers }) => (
	<ListPokemonFamilyLoader familyID={familyID}>
		<Row>
			{familyMembers.map(pokemon => (
				<Col>{pokemon.name}</Col>
			))}
		</Row>
	</ListPokemonFamilyLoader>
)

const mapState = state => ({
	familyMembers: state.pokemonFamily.list
})

export default connect(mapState)(ListPokemonFamily)
